INSERT INTO `blast_content` VALUES ('116', '1', '1', '1490716800', '【充值提示】', '<p>\n	<strong><span style=\"font-size:16px;\">尊敬的会员您好，平台微信和支付宝充值二维码定期会更换，请您每次入款时都要扫描平台最新二维码并进行核对，如您使用过期的二维码付款充值而导致不能到账，平台恕不负责，谢谢您的配合，祝您购彩娱乐！</span></strong> \n</p>\n<p>\n	<br />\n</p>\n<p>\n	<br />\n</p>\n<p>\n	<br />\n</p>\n<p>\n	<strong>星河娱乐财务部</strong> \n</p>');
INSERT INTO `blast_content` VALUES ('117', '1', '1', '1494086400', '【系统升级公告】', '<p>\n	<strong><span style=\"font-size:16px;\">尊敬的各位会员您好，为了给广大玩家创造更好的购彩环境，</span></strong><strong><span style=\"font-size:16px;\">星河娱乐平台定于2017年5月8日晚24:00进行系统全面升级！届时给您带来的不便敬请谅解，感谢您长久以来对星河娱乐的支持！ </span></strong> \n</p>\n<p>\n	<strong><span style=\"font-size:16px;\"><br />\n</span></strong> \n</p>\n<p>\n	<strong><span style=\"font-size:16px;\"> 星河娱乐技术部</span></strong> \n</p>');
INSERT INTO `blast_content` VALUES ('118', '1', '1', '1495987200', '【感恩赠金活动】', '<p align=\"center\" style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<strong><span style=\"color:#E53333;font-size:24px;\">活动一：注册送18元，</span></strong><strong><span style=\"color:#E53333;font-size:24px;\">满一百即可提现</span></strong><strong><span style=\"color:#E53333;font-size:24px;\">【会员版】</span></strong> \n</p>\n<p align=\"center\" style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<strong></strong> \n</p>\n<p align=\"left\" style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<strong>【活动对象】：<strong>星河娱乐</strong>新注册会员</strong> \n</p>\n<p align=\"left\" style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<strong>【活动时间】：2017年5月30日00 : 00----2017年8月30日23 : 59</strong> \n</p>\n<p align=\"left\" style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<strong>【活动内容】：会员首次注册绑定卡，联系在线客服领取18元红包，余额满一百元即可提款。</strong> \n</p>\n<p align=\"left\" style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<strong>【活动要求】：此活动会员账户余额到100元即可出款，最高出款金额为300元，此活动不限彩种，不限玩法，不限制投注注数。</strong> \n</p>\n<p align=\"left\" style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<strong>【领取方式】：联系在线客服或者QQ客服领取红包</strong> \n</p>\n<p style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<strong>【活动须知】:每名会员只能申请一次，相同IP地址、相同安全信息的用户只能申请一次，如发现重复申请或者利用多账户对打套利。风控部门有权没收优惠及其盈利。</strong> \n</p>\n<p align=\"center\" style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<strong><span style=\"color:#E53333;font-size:24px;\">活动二：充值送红包，一倍流水即可出款【会员版】</span></strong> \n</p>\n<p align=\"left\" style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<strong>【活动对象】：星河娱乐所有会员</strong> \n</p>\n<p align=\"left\" style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<strong>【活动时间】：2017年5月30日00 : 00 ----2017年8月30日23 : 59</strong> \n</p>\n<p align=\"left\" style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<strong>【活动内容】：冲1000送18元；冲5000送88元；冲10000送188元</strong> \n</p>\n<p align=\"left\" style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<strong>【活动要求】：此红包无任何限制，一倍流水即可提款。注：奖金到账后开始计算了流水</strong> \n</p>\n<p align=\"left\" style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<strong>【领取方式】：请在未投注前联系在线客服或者QQ客服领取红包。</strong> \n</p>\n<p align=\"center\" style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<strong></strong> \n</p>\n<p align=\"left\" style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<strong>【活动须知】: 每名会员每天只能申请一次，相同IP地址、相同安全信息的用户只能申请一次，如发现重复申请或者利用多账户对打套利。风控部门有权没收优惠及其盈利。</strong> \n</p>\n<p align=\"left\" style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<strong></strong> \n</p>\n<p align=\"left\" style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<br />\n</p>\n<p align=\"left\" style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<strong></strong> \n</p>\n<p align=\"right\" style=\"font-family:\'Times New Roman\', Times, serif;font-size:16px;\">\n	<strong>星河娱乐财务部</strong> \n</p>');
