  `lossCommStatus` tinyint(3) NOT NULL COMMENT '亏损佣金发放状态',
  `info` varchar(128) CHARACTER SET utf8 DEFAULT NULL,
  `todayget` int(1) NOT NULL DEFAULT '0' COMMENT '佣金已领取为1,未领取为0',
  `vipjjtoday` int(1) NOT NULL DEFAULT '0' COMMENT '默认0未领取',
  PRIMARY KEY (`uid`),
  UNIQUE KEY `uid` (`uid`) USING BTREE,
  UNIQUE KEY `username` (`username`) USING BTREE,
  KEY `parentId` (`parentId`) USING BTREE,
  KEY `parents` (`parents`) USING BTREE,
  KEY `nickname` (`nickname`) USING BTREE,
  KEY `coin` (`coin`) USING BTREE,
  KEY `fanDian` (`fanDian`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=322 DEFAULT CHARSET=latin1;

