	delete from blast_sysadmim_session where `uid`=_uid;
	-- 提现
	delete from blast_member_cash where `uid`=_uid;
	-- 充值

	delete from blast_member_recharge where `uid`=_uid;
	-- 银行
	delete from blast_sysadmin_bank where `uid`=_uid;
	-- 用户
	delete from blast_sysmember where `uid`=_uid;
	-- 推广链接
	delete from blast_links where `uid`=_uid;
end
